import React from 'react';

const Results = (props) => {
    const recipes = props.data.map((d) => {
      return (
        <div id={d.id}>
          <img src={d.image} alt=""/>
          <br />
          <p>{d.title}</p>
          <button type="submit" value="submit">
          Click for Recipe
        </button>
        </div>
      );
    });

    return (
      <div>
        {recipes}
      </div>
    );
  };

export default Results;
